import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import './Home.css';

const Home = () => {
    return (
        <div className="container-fluid">
            {/* Navbar */}
            <nav className="navbar navbar-expand-lg navbar-light bg-light">
                <div className="container-fluid">
                    <a className="navbar-brand" href="#">Para Birimi Uygulaması</a>
                    <button className="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarNav" aria-controls="navbarNav" aria-expanded="false" aria-label="Toggle navigation">
                        <span className="navbar-toggler-icon"></span>
                    </button>
                    <div className="collapse navbar-collapse" id="navbarNav">
                        <ul className="navbar-nav me-auto">
                            {/* Para Birimleri (Navbar içinde) */}
                            <li className="nav-item">
                                <div className="nav-link currency-box">Para Birimi 1</div>
                            </li>
                            <li className="nav-item">
                                <div className="nav-link currency-box">Para Birimi 2</div>
                            </li>
                            <li className="nav-item">
                                <div className="nav-link currency-box">Para Birimi 3</div>
                            </li>
                            <li className="nav-item">
                                <div className="nav-link currency-box">Para Birimi 4</div>
                            </li>
                            <li className="nav-item">
                                <div className="nav-link currency-box">Para Birimi 5</div>
                            </li>
                        </ul>
                        {/* Register Butonu (Navbar içinde) */}
                        <button className="btn btn-outline-success" type="button">Register</button>
                    </div>
                </div>
            </nav>

            <div className="row">
                {/* Sol Reklam Alanı (2 grid) */}
                <div className="col-md-2 col-sm-12">
                    <div className="advertisement" style={{ height: '80vh' }}>
                        <h4>Reklam Alanı 1</h4>
                        {/* Reklam içeriği */}
                    </div>
                </div>

                {/* Para Birimleri ve Register (8 grid) */}
                <div className="col-md-8 col-sm-12">
                    {/* Para grafiği (2 grid altında) */}
                    <div className="chart-section">
                        <h4>Para Birimi Grafiği</h4>
                        {/* Grafik bileşeni buraya gelecek */}
                    </div>
                </div>

                {/* Sağ Reklam Alanı (2 grid) */}
                <div className="col-md-2 col-sm-12">
                    <div className="advertisement" style={{ height: '80vh' }}>
                        <h4>Reklam Alanı 2</h4>
                        {/* Reklam içeriği */}
                    </div>
                </div>
            </div>
        </div>
    );
};

export default Home;
